import React, { Component } from 'react';
import { Button, Text, Wrapper } from './Opinion.styled'

class Opinion extends Component {
	state = {
		good: 1,
		neutral: 1,
		bad: 1,
	}

	render() {

		const { good, neutral, bad } = this.state
		return (
			<Wrapper>
				<Text> Please leave feetback</Text>

				<Button>Good</Button>
				<Button>Neutral</Button>
				<Button >Bad</Button>

				<Text>Statistics</Text>
				<ul>
					<li>Good</li><span>{good}</span>
					<li>Neutral</li><span>{neutral}</span>
					<li>Bad</li><span>{bad}</span>
				</ul>
			</Wrapper>
		);
	}
}
export default Opinion;
